import React from 'react'
import ReactDOM from 'react-dom'
import {Netflix, Counter} from './app'

//Some Constant Declaration
const curly = '{}'

//Internal Styling using Object Notation
var decoration1 = {fontFamily: "sans-serif", color : "rgb(120,120,120)", fontSize: "25px"}



//In React v16 it's possible for render()
// to return multiple element

//React.Fragment is used because it is faster than array
// and uses less memory than div

const comprehension = 'I started learning react on 4-2-21 at 18:01 P.M.'
ReactDOM.render(

  <React.Fragment>
    <h1 style = {decoration1}>{comprehension}</h1>
    <Netflix />

    <h1>Tips and Tricks in React</h1>
    <p>Sum of 2 + 3 is {2 + 3}</p>
    <p>Trick to show Math.random() 
      using Javascript element is {Math.random()}</p>
    <b>You can only use expression inside{curly}
      and not statement(like if, for, while)</b>
     <h2> <Counter /> </h2>
  </React.Fragment>,

  document.getElementById('root')
);





//Adding New Elements Using Javascript 

var h3 = document.createElement('h3')
h3.innerHTML = "This Tag is created using Javascript"
h3.style.fontFamily = "sans-serif"
document.getElementById('root').appendChild(h3)
